import { Routes, Route } from "react-router-dom";

import Home from "../app/Home";
import BoardList from "../board/BoardList";


function Router() {
    return(
        <Routes>
            <Route path="/" element={<Home/>} />

            <Route path="/boardlist" element={<BoardList/>}></Route>
        </Routes>
    )
}

export default Router;
